import './App.css';
import React from "react";
import SomeInformation from "./components/SomeInformation.js";
import DayPlan from "./components/DayPlan.js";
import Person from "./components/Person.js";
import TextAndDateInformation from "./components/TextAndDateInformation.js";
import {Link, Route, Router} from "react-router-dom";

function MainPage() {
    return (
        <body>
        <head>
            <link rel="preconnect" href="https://fonts.googleapis.com"/>
            <link rel="preconnect" href="https://fonts.gstatic.com" crossOrigin/>
            <link href="https://fonts.googleapis.com/css2?family=Bad+Script&display=swap" rel="stylesheet"/>
        </head>

        <div className="page">

            <div>
                <SomeInformation/>
                <TextAndDateInformation/>
                <DayPlan/>
                <Person/>
            </div>

        </div>
        </body>
    );
}




function App() {
    return (
        <Router>
            <div>
                {/* Set up the navigation links */}
                <nav>
                    <ul>
                        <li><Link to="/main">Main</Link></li>
                    </ul>
                </nav>

                {/* Set up the routes */}
                <Route path="/main" exact component={MainPage} />
            </div>
        </Router>

    );
}

export default App;
